import React, {useEffect, useState} from 'react'
import './catFacts.css'

export const CatFacts = () => {
  const [facts, setFacts] = useState([]);

  useEffect(async() => {
    await console.log(facts)
  },)

  const update = async () => {
    try {
      const newFact = await fetch('https://cat-fact.herokuapp.com/facts/random');
      const fact = await newFact.text;

      return await fact;
    } catch (err) {
      console.error(err);
    }
  }

  return (
    <div>
      <button id='btn' onClick={async () => await setFacts([update])}></button>
      <ul>{facts.map()}</ul>
    </div>
  )
}
